import "./style.css";
import { useStarred } from "../../context/StarredContext";
import { useState } from "react";
const HomeScreen = ({username}) => {
  const { repos ,setRepos } = useStarred();
  return (
    <div>
      <h1>Starred Repos</h1>
      {repos.map(element => { 
        return (
          <div className="starred-repo-container">
            <a href="`github.com/${element}`">
              
            </a>
                 <p className="starred-repo">{element}<br></br></p>
          </div>
     
          
         );
      })
      }
    </div>
  );
};

export default HomeScreen;
